import React from 'react';

export default function Home() {
  return (
    <div className="container text-center py-5">
      <h1 className="display-4 text-primary fw-bold">Welcome to CleanSwift</h1>
      <p className="lead mb-4">Reliable & affordable home cleaning services</p>

      <img
        src="https://static.vecteezy.com/system/resources/previews/015/480/962/non_2x/home-or-office-cleaning-company-service-website-banner-or-flyer-template-with-trendy-characters-of-cleaners-staff-working-dry-and-wet-clean-dry-cleaning-of-furniture-cartoon-illustration-free-vector.jpg"
        alt="Home Cleaning"
        className="img-fluid rounded shadow-lg"
        style={{ maxHeight: '400px',width:'1500px', objectFit: 'cover' }}
      />

      <div className="mt-5">
        <a href="/booking" className="btn btn-primary btn-lg">
          Book a Cleaning Now
        </a>
      </div>
    </div>
  );
}
